fragment:
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rumination_disorder rdfs:subClassOf :eating_disorder ;
    :has_definition "An eating disorder that is characterized by effortless regurgitation of most meals following consumption." ;
    :has_exact_synonym "Psychogenic rumination"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:budd_chiari_syndrome rdfs:subClassOf :hepatic_vascular_disease ;
    :has_definition "A hepatic vascular disease that is characterized by a spectrum of disease states, including anatomic abnormalities and hypercoagulable disorders, resulting in hepatic venous outflow occlusion." ;
    :has_exact_synonym "hepatic vein thrombosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypertensive_heart_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :high_blood_pressure ],
        :heart_disease ;
    :has_definition "A heart disease that is caused by high blood pressure." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_hypertensive_renal_disease rdfs:subClassOf :renal_hypertension ;
    :has_exact_synonym "hypertensive renal disease, benign"@en,
        "hypertensive renal disease, benign, without mention of renal failure"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:laryngostenosis rdfs:subClassOf :laryngeal_disease ;
    :has_exact_synonym "Stenosis of larynx"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:recurrent_corneal_erosion rdfs:subClassOf :corneal_degeneration ;
    :has_exact_synonym "recurrent erosion of cornea"@en,
        "recurrent erosion syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corneal_deposit rdfs:subClassOf :corneal_disease ;
    :has_exact_synonym "Deposits - cornea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adie_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is a neurological disorder affecting the pupil of the eye and the autonomic nervous system. It is characterized by one eye with a pupil that is larger than normal and constricts slowly in bright light (tonic pupil), along with the absence of deep tendon reflexes, usually in the Achilles tendon." ;
    :has_exact_match "MESH:D000270" ;
    :has_exact_synonym "Adie's pupil or syndrome"@en,
        "Adie's pupil syndrome"@en,
        "Adie's syndrome"@en,
        "Holmes-Adie syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculomotor_nerve_paralysis rdfs:subClassOf :third_cranial_nerve_disease ;
    :has_exact_synonym "III nerve palsy"@en,
        "IIIrd nerve Paralysis"@en,
        "Third cranial nerve paralysis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bowman_s_membrane_folds_or_rupture rdfs:subClassOf :corneal_disease ;
    :has_exact_synonym "Bowman membrane folds or rupture"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chandler_syndrome rdfs:subClassOf :corneal_dystrophy ;
    :has_definition "A corneal dystrophy that is characterized by corneal edema, iris atrophy, and secondary angle-closure glaucoma caused by an inflammatory or infectious insult that causes the endothelium to fail to pump aqueous humor from the cornea, leading to fluid accumulation, microcystic edema, and angle-closure glaucoma." ;
    :has_exact_synonym "Chandler's syndrome"@en,
        "Dystrophy of corneal endothelium"@en,
        "Endothelial corneal dystrophy"@en,
        "Posterior membrane corneal dystrophy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fuchs_endothelial_dystrophy rdfs:subClassOf :corneal_endothelial_dystrophy ;
    :has_definition "A corneal dystrophy characterized by accumulation of focal outgrowths (guttae) and thickening of Descemet's membrane, leading to corneal edema and loss of vision." ;
    :has_exact_synonym "FCED"@en,
        "Fuchs' corneal dystrophy"@en,
        "Fuchs' endothelial corneal dystrophy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_serous_otitis_media rdfs:subClassOf :acute_transudative_otitis_media ;
    :has_definition "A acute transudative otitis media with thin, watery and sterile effusion." ;
    :has_exact_synonym "acute non-suppurative otitis media - serous"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_allergic_serous_otitis_media rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        :acute_serous_otitis_media,
        :allergic_disease ;
    :has_definition "A acute serous otitis media caused by an allergen." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chondrocalcinosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :arthritis ],
        :arthritis ;
    :has_definition "An arthritis that has_material_basis_in the accumulation of salt crystals located_in joint." ;
    :has_exact_synonym "calcium pyrophosphate deposition disease"@en,
        "pseudogout"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_vasculitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :retinal_vascular_disease,
        :vasculitis ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vasculitis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :retina ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A vasculitis that is characterized by inflammation of the vascular branches of the retinal artery and has_symptom painless decrease of visual acuity, visual floaters, dark spot in vision, decreased ability to distinguish colors, and distortion of images such as linear images." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurocirculatory_asthenia rdfs:subClassOf :somatoform_disorder ;
    :has_definition "A somatoform disorder that involves heart disease symptoms without any identifiable physiological abnormalities." ;
    :has_exact_synonym "Cardiovascular malfunction arising from mental factors"@en,
        "Cardiovascular neurosis"@en,
        "Da Costa's syndrome"@en,
        "Krishaber's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:listeria_meningitis rdfs:subClassOf :bacterial_meningitis ;
    :has_definition "A bacterial meningitis that has_material_basis_in Listeria monocytogenes infection." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:listeriosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :congenital_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_ingestion_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :listeria ;
                            rdf:rest [ rdf:first :listeria_monocytogenes ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :backache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in infection, has_material_basis_in Listeria monocytogenes, which is transmitted_by ingestion of contaminated food or raw milk or transmitted_by congenital method. Ingestion of Listeria by pregnant women has_symptom nausea, has_symptom vomiting, has_symptom diarrhea, has_symptom fever, has_symptom malaise, has_symptom back pain, and has_symptom headache. Maternal infection with Listeria can result in chorioamnionitis, premature labor, spontaneous abortion, or stillbirth." ;
    :has_exact_synonym "Infection by Listeria monocytogenes"@en,
        "Listeria infection"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:streptococcal_meningitis rdfs:subClassOf :bacterial_meningitis ;
    :has_definition "A bacterial meningitis that has_material_basis_in streptococcal bacteria." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cauda_equina_syndrome rdfs:subClassOf :peripheral_nervous_system_disease,
        :syndrome ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :syndrome ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cauda_equina ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A peripheral nervous system disease that involves an acute loss of function of the lumbar plexus, neurologic elements (nerve roots) of the spinal canal below the termination (conus) of the spinal cord." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:phlyctenulosis rdfs:subClassOf :keratoconjunctivitis ;
    :has_exact_synonym "Phlyctenular keratoconjunctivitis"@en,
        "Strumous ophthalmia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:riley_day_syndrome rdfs:subClassOf :hereditary_sensory_neuropathy ;
    :has_definition "A hereditary sensory neuropathy that is characterized by gastrointestinal dysfunction, gastroesophageal reflux, vomiting crises, recurrent pneumonia, seizures, gait abnormalities with loss of ambulation, kyphoscoliosis, postural hypotension, hypertension crises, absence of fungiform papillae on the tongue, decreased deep tendon reflexes, defective lacrimation, and impaired pain and temperature perception and has_material_basis_in homozygous or compound heterozygous mutation in the IKBKAP gene (ELP1) on chromosome 9q31." ;
    :has_exact_synonym "HSAN III"@en,
        "familial autonomic nervous dysfunction"@en,
        "familial dysautonomia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_lateral_wall_cancer rdfs:subClassOf :urinary_bladder_cancer ;
    :has_exact_synonym "Lateral Wall of bladder"@en,
        "malignant neoplasm of lateral wall of urinary bladder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scleral_staphyloma rdfs:subClassOf :scleral_disease ;
    :has_exact_synonym "Scleral ectasia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:frey_syndrome rdfs:subClassOf :autonomic_nervous_system_disease ;
    :has_definition "An autonomic nervous system disease that is characterized by facial sweating and flushing with gustatory stimulation, resulting from a disruption of the auriculotemporal nerve pathways." ;
    :has_exact_synonym "Baillarger syndrome"@en,
        "gustatory hyperhidrosis"@en,
        "gustatory sweating"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pericardium_cancer rdfs:subClassOf :heart_cancer,
        :pericardium_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :pericardium ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Pericardial tumor"@en,
        "malignant neoplasm of pericardium"@en,
        "malignant tumor of Pericardium"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infant_gynecomastia rdfs:subClassOf :breast_disease ;
    :has_definition "A breast disease that is characterized by benign proliferation of glandular breast tissue and occurs in children less than one year of age." ;
    :has_exact_synonym "Neonatal gynaecomastia"@en,
        "breast engorgement in newborn"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fungal_meningitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :fungi ],
        :fungal_infectious_disease,
        :meningitis ;
    :has_definition "A meningitis that has_material_basis_in a fungal infection." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polycystic_ovary_syndrome rdfs:subClassOf :ovarian_dysfunction ;
    :has_definition "An ovarian dysfunction that is characterized by hyperandrogenism, polycystic ovaries, hirsutism, oligomenorrhea or amenorrhea, anovulation and excessive body weight." ;
    :has_exact_synonym "Multicystic ovaries"@en,
        "PCOS"@en,
        "Polycystic Ovarian disease"@en,
        "Polycystic ovaries"@en,
        "Stein-Leventhal synd."@en,
        "Stein-Leventhal syndrome"@en,
        "polycystic ovary"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperandrogenism rdfs:subClassOf :disorder_of_sexual_development ;
    :has_exact_synonym "hyperandrogenization syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:penile_cancer rdfs:subClassOf :male_reproductive_organ_cancer,
        :penile_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :penis ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Ca penis"@en,
        "Penile Ca"@en,
        "malignant Penile tumor"@en,
        "malignant neoplasm of body of penis"@en,
        "penile neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dental_pulp_necrosis rdfs:subClassOf :dental_pulp_disease ;
    :has_definition "A dental pulp disease characterized by death of the pulp tissue." ;
    :has_exact_synonym "necrosis of the pulp"@en,
        "necrotic pulp"@en,
        "pulp necrosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:penile_benign_neoplasm rdfs:subClassOf :male_reproductive_organ_benign_neoplasm,
        :penile_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :penis ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Penile tumor"@en,
        "neoplasm of penis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pelvic_muscle_wasting rdfs:subClassOf :prolapse_of_female_genital_organ ;
    :has_definition "A prolapse of female genital organ that is characterized by a decrease in muscle mass and tissue in the pelvic floor, vagina, vulva and urinary tract due to aging, menopause and its subsequent reduction of estrogen, or a combination of the two." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thyroid_hormone_resistance_syndrome rdfs:subClassOf :hypothyroidism ;
    :has_exact_synonym "Generalized thyroid hormone resistance"@en,
        "Refetoff syndrome"@en,
        "Thyroid hormone responsiveness defect"@en,
        "thyroid hormone resistance"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:accommodative_spasm rdfs:subClassOf :eye_accommodation_disease ;
    :has_exact_synonym "Spasm of accommodation"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bronchopulmonary_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :neonatal_onset ],
        :lung_disease ;
    :has_definition "A lung disease that is characterized by underdeveloped lungs in newborns that can be easily irritated or inflamed after birth resulting in damage to the alveoli of the lungs and bronchi. Most newborns who develop BPD are born more than 10 weeks before their due dates, weigh less than 2 pounds at birth, and have breathing problems." ;
    :has_exact_synonym "Chronic lung disease of prematurity",
        "Neonatal chronic lung disease",
        "Respiratory insufficiency",
        "Bronchopulmonary dysplasia of newborn"@en,
        "Perinatal bronchopulmonary dysplasia"@en,
        "neonatal chronic respiratory disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cicatricial_pemphigoid rdfs:subClassOf :pemphigoid ;
    :has_definition "A pemphigoid that is characterized by skin lesions and scaring and located_in mucous membranes and located_in skin." ;
    :has_exact_synonym "Cicatricial pemphigoid with ocular involvement"@en,
        "Ocular pemphigoid"@en,
        "benign mucous membrane pemphigoid"@en,
        "benign mucous membrane pemphigoid with ocular involvement"@en,
        "ocular pemphigus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:palindromic_rheumatism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :arthritis ],
        :arthritis ;
    :has_definition "An arthritis that involves sudden and rapidly developing attacks of arthritis with a remission period that results_in no joint damage or symptoms." ;
    :has_exact_synonym "Hench's syndrome"@en,
        "Hench-Rosenberg syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blue_color_blindness rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :color_blindness ;
    :has_definition "A color blindness that is characterized by a selective deficiency of blue vision, has_material_basis_in autosomal dominant inheritance of a mutation in the OPN1SW gene and is associated with a deficiency or absence of blue-sensitive cone photoreceptor function." ;
    :has_exact_synonym "Tritan defect"@en,
        "Tritanopia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nephrosclerosis rdfs:subClassOf :renal_hypertension ;
    :has_exact_synonym "renal sclerosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:patau_syndrome rdfs:subClassOf :chromosomal_disease ;
    :has_exact_synonym "D1 Trisomy"@en,
        "trisomy 13"@en ;
    :has_related_synonym "Patau's syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypopigmentation_of_eyelid rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eyelid ],
        :eyelid_disease,
        :pigmentation_disease ;
    :has_definition "A pigmentation disease that is characterized by loss of pigmentation of the eyelid and has_symptom white or light macules or patches on the eyelid, and has_material_basis_in autoimmune conditions like vitiligo, chronic inflammation, malignancy, or exposure to destructive substances." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypertrichosis_of_eyelid rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eyelid ],
        :eyelid_disease,
        :hypertrichosis .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypotrichosis_of_eyelid rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eyelid ],
        :eyelid_disease,
        :hypotrichosis .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:onchocerciasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :blindness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :onchocerca_volvulus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :itching ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :enlargement_of_lymph_nodes ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :eczema ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :dermatitis ],
        :filariasis ;
    :has_definition "A filariasis that involves parasitic infection caused by the nematode Onchocerca volvulus, which is transmitted to humans through the bite of a blackfly of the genus Simulium. The worms spread throughout the body and, when they die, cause intense itching and a strong immune system response that can destroy nearby tissue. The symptoms include pruritus, dermatitis, blindness, onchocercomata (subcutaneous nodules), and lymphadenopathy." ;
    :has_exact_synonym "Infection by Onchocerca volvulus"@en,
        "Onchocerca volvulus infection"@en,
        "volvulosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_hyperlipidemia rdfs:subClassOf :lipid_metabolism_disorder ;
    :has_exact_synonym "familial hyperlipoproteinemia"@en,
        "hyperlipemia"@en ;
    :has_related_synonym "hyperlipidaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_apical_periodontitis rdfs:subClassOf :periapical_periodontitis ;
    :has_exact_synonym "acute apical periodontitis of pulpal origin"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:portal_vein_thrombosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vein ],
        :hepatic_vascular_disease,
        :thrombosis,
        :vein_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :thrombosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
