:prader_willi_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :symptom ],
        [ a owl:Restriction ;
            owl:minQualifiedCardinality "1"^^xsd:nonNegativeInteger ;
            owl:onClass [ owl:unionOf [ rdf:first [ owl:intersectionOf [ rdf:first :maternal_uniparental_disomy ;
                                            rdf:rest [ rdf:first :loss_of_function_variant ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :paternal_variant ;
                                                    rdf:rest [ rdf:first :loss_of_function_variant ;
                                                            rdf:rest [ rdf:first :chromosomal_deletion ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :loss_of_function_variant ;
                                                            rdf:rest [ rdf:first :chromosomal_translocation ;
                                                                    rdf:rest :nil ] ] ] ;
                                            rdf:rest :nil ] ] ] ] ;
            owl:onProperty :has_material_basis_in ],
        :chromosomal_disease,
        :syndrome ;
    :has_definition "A chromosomal disease that is characterized by weak muscle tone, feeding difficulties, poor growth, and delayed development. Beginning in childhood, affected individuals develop an insatiable appetite, which leads to chronic overeating and obesity." ;
    :has_exact_synonym "Prader Willi syndrome"@en .

