    :has_exact_synonym "Conn syndrome"@en,
        "primary aldosteronism"@en,
        "primary hyperaldosteronism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

