    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_symptom ;
                                    owl:someValuesFrom :allergic_reaction ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An immune system disease that is an exaggerated immune response to allergens, such as insect venom, dust mites, pollen, pet dander, drugs or some foods." ;
    :has_exact_synonym "allergic hypersensitivity disease"@en,
        "hypersensitivity"@en,
        "hypersensitivity reaction type I disease"@en ;
    :obi_9991118 "allergic disease" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cryptococcosis rdfs:subClassOf :opportunistic_mycosis ;
    :has_definition "An opportunistic mycosis that results_in fungal infection and has_material_basis_in Cryptococcus neoformans or Cryptococcus gattii." ;
    :has_exact_match "MESH:D003453" ;
    :has_exact_synonym "Busse-Buschke's disease"@en,
        "European cryptococcosis"@en,
        "cryptococcal infection"@en,
        "torula"@en,
        "torulosis"@en ;
    :has_related_synonym "cryptococcus neoformans infection"@en .

