    :has_definition "A lung disease that is characterized the accumulation of tiny fragments of calcium phosphate gradually accumulate in the alveoli of the lungs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_hemosiderosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        :hemosiderosis,
        :lung_disease ;
    :has_definition "A lung disease with an unknown etiology affecting the lungs which results in bleeding from tiny alveolar capillaries. Examination of sputum and bronchoalveolar lavage fluid can disclose hemosiderin-laden alveolar macrophages (siderophages), and the lung biopsy shows numerous siderophages in the alveoli. Alveolar hemorrhage is characterized by hemoptysis, shortness of breath, alveolar infiltrates on chest radiograph, and various degrees of anaemia. Following a bleeding episode, the alveolar macrophages convert the hemoglobin's iron into hemosiderin within 36-72h." ;
    :has_exact_synonym "Idiopathic pulmonary hemosiderosis"@en,
        "brown induration"@en,
        "brown lung"@en .

