@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:episcleritis_periodica_fugax rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :photophobia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        :scleral_disease ;
    :has_definition "A scleral disease that is characterized by painful inflammation of the episcleral tissues that, importantly, spares the sclera itself and has_symptom pain, red eyes, photophobia, tearing, and blurry vision. Episcleritis periodica fugax is typically self-limited but may be related to vascular congestion within the superficial episcleral plexus and associated with autoimmune disease, connective tissue disease, malignancies, trauma, infection, and medications, especially topiramate and pamidronate." .

