    :has_definition "An autoimmune disease that is characterized by necrotizing granulomatous inflammation of the upper and lower respiratory tract, glomerulonephritis, vasculitis, and the presence of antineutrophil cytoplasmatic autoantibodies (ANCAs) in patient sera, and is located_in lung, located_in kidney, located_in skin resulting from an autoimmune attack by antineutrophil cytoplasmic antibodies against small and medium-size blood vessels." ;
    :has_exact_synonym "Necrotizing respiratory granulomatosis"@en,
        "Wegener granulomatosis, formerly"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
