    :has_definition "A blood coagulation disease that has_material_basis_in Factor VIII deficiency, which results in the formation of fibrin deficient clots which makes coagulation much more prolonged." ;
    :has_exact_match "MESH:D006467" ;
    :has_exact_synonym "Congenital factor VIII disorder"@en,
        "Hemophilia A"@en,
        "Subhemophilia"@en,
        "classic hemophilia A"@en .

