        :trypanosomiasis ;
    :has_definition "A trypanosomiasis that is a tropical parasitic disease caused by the flagellate protozoan Trypanosoma cruzi, which is transmitted to humans and other mammals by an insect vector, the blood-sucking assassin bugs of the subfamily Triatominae (family Reduviidae), most commonly species belonging to the Triatoma, Rhodnius, and Panstrongylus genera. The symptoms include fever, fatigue, body aches, headache, rash, loss of appetite, diarrhea, vomiting, swelling of the eyelids and myocarditis." ;
    :has_exact_synonym "Chagas' disease"@en,
        "chagas' disease with digestive system involvement"@en,
        "chagas' disease with nervous system involvement"@en,
        "chagas' disease with other organ involvement"@en ;
    :has_related_synonym "American trypanosomiasis"@en .

