        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :decreased_circulating_antibody_level ],
        :agammaglobulinemia,
        :autoimmune_disease,
        :autosomal_recessive_disease ;
    :has_definition "An agammaglobulinemia that is characterized by low Ig levels with phenotypically normal B cells that can proliferate but do not develop into Ig-producing cells and that esults in insufficient production of antibodies needed to respond to exposure of pathogens." ;
    :has_exact_synonym "CVID"@en,
        "acquired agammaglobulinemia"@en,
        "acquired hypogammaglobulinemia"@en,
        "common variable agammaglobulinemia"@en,
        "sporadic hypogammaglobulinemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

