    :has_definition "An otitis interna characterized by isolated endochondral bone sclerosis of the labyrinthine capsule." ;
    :has_exact_match "MESH:D010040" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

