        "malignant neoplasm of intrahepatic biliary passages"@en,
        "malignant neoplasm of intrahepatic gall duct"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bloch_sulzberger_syndrome rdfs:subClassOf :pigmentation_disease ;
    :has_exact_synonym "Incontinentia pigmenti"@en,
        "Incontinentia pigmenti syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vitiligo rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :zone_of_skin ;
                            rdf:rest [ rdf:first :connective_tissue ;
                                    rdf:rest :nil ] ] ] ],
        :autoimmune_disease_of_skin_and_connective_tissue ;
    :has_definition "An autoimmune disease that causes depigmentation of patches of skin resulting from loss of function or death of melanoctyes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anterior_corneal_pigmentation rdfs:subClassOf :corneal_deposit ;
    :has_exact_synonym "Anterior corneal pigmentations"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dubin_johnson_syndrome rdfs:subClassOf :bilirubin_metabolic_disorder ;
    :has_definition "A bilirubin metabolic disorder that involves elevated levels of unconjugated bilirubin without elevation of liver alanine transaminase and aspartate transaminase enzymes as a result of the deficient ability of hepatocytes to secrete conjugated bilirubin into the bile." ;
    :has_exact_synonym "Dubin Johnson syndrome"@en,
        "chronic idiopathic jaundice"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urticaria_pigmentosa rdfs:subClassOf :cutaneous_mastocytosis ;
    :has_exact_match "MESH:D014582" ;
    :has_exact_synonym "UP/MPCM"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stromal_corneal_pigmentation rdfs:subClassOf :pigmentation_disease ;
    :has_exact_synonym "Stromal corneal pigmentations"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:granular_corneal_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :epithelial_stromal_tgfbi_dystrophy ;
    :has_definition "An epithelial-stromal TGFBI dystrophy that is characterized by progressive accumulation of deposits within the layers of the cornea." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cough_variant_asthma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by chronic nonproductive cough without shortness of breath." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marasmus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :decreased_metabolism ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hypothermia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :emaciation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :constipation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_height ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bradycardia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_gain ],
        :protein_energy_malnutrition ;
    :has_definition "A protein-energy malnutrition that is characterized by severe caloric deprivation, has_symptom emaciation, decreased height and weight gain, and decreased metabolism with hypothermia, bradycardia, and constipation, and has_material_basis_in severe caloric deprivation." ;
    :has_exact_synonym "Nutritional atrophy"@en,
        "Nutritional marasmus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transvestism rdfs:subClassOf :fetishism ;
    :has_exact_synonym "Dual-role transvestism"@en,
        "Fetishistic transvestism"@en,
        "Transvestic fetishism"@en,
        "cross dresser"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hematocele_of_tunica_vaginalis_testis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :testis ],
        :testicular_disease ;
    :has_exact_synonym "Hematocele"@en,
        "male hematocele"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:male_genital_organ_stricture rdfs:subClassOf :male_reproductive_system_disease ;
    :has_exact_synonym "Stricture of male genital organs"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:male_genital_organ_vascular_disease rdfs:subClassOf :male_reproductive_system_disease ;
    :has_exact_synonym "vascular disorder of male genital organs"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:varicocele rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :spermatic_cord ],
        :pelvic_varices ;
    :has_exact_synonym "Scrotal varices"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retroperitoneal_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :lymphoma,
        :retroperitoneal_cancer .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gender_incongruence rdfs:subClassOf :sexual_health_disorder ;
    :has_definition "A sexual health disorder that involves a conflict between a person's actual physical gender and the gender that person identifies himself or herself as." ;
    :has_exact_synonym "gender dysphoria",
        "gender identify disorder",
        "transsexualism" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retroperitoneal_sarcoma rdfs:subClassOf :retroperitoneal_cancer ;
    :has_definition "A malignant retroperitoneal cancer and sarcoma that is located_in the retroperitoneal space." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retroperitoneum_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :carcinoma,
        :retroperitoneal_cancer ;
    :has_exact_synonym "carcinoma of Retroperitoneum"@en ;
    :has_related_synonym "carcinoma of the retroperitoneum"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteogenesis_imperfecta rdfs:subClassOf :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that has_material_basis_in a deficiency in type-I collagen which results_in brittle bones and defective connective tissue." ;
    :has_exact_synonym "Lobstein's syndrome"@en,
        "Osteopsathyrosis"@en,
        "Vrolik's disease"@en,
        "brittle bone disease"@en ;
    :has_related_synonym "Fragilitas ossium"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_eye_hypotony rdfs:subClassOf :ocular_hypotension ;
    :has_exact_synonym "primary hypotony of eye"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alcoholic_hepatitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        :hepatitis ;
    :has_exact_synonym "acute alcoholic hepatitis"@en,
        "acute alcoholic liver disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viral_labyrinthitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dizziness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_balance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :viruses ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tinnitus ],
        :labyrinthitis,
        :viral_infectious_disease ;
    :has_definition "A labyrinthitis which involves viral infection of the inner ear through the upper airway or the blood stream. The symptoms may include hearing loss and ringing in the ears. If the virus reaches the vestibular system, dizziness, severe vertigo with nausea and vomiting, and imbalance can occur." ;
    :has_exact_synonym "Epidemic vertigo"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:patulous_eustachian_tube rdfs:subClassOf :eustachian_tube_disease ;
    :has_definition "A eustachian tube disorder with a wider eustachian tube which allows a larger bolus of bacteria-laden material from the nasopharynx during an infection to enter the middle ear, causing a more fulminant infection." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lateral_displacement_of_eye rdfs:subClassOf :orbital_disease ;
    :has_exact_synonym "Lateral displacement of globe"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:graves_disease rdfs:subClassOf :autoimmune_disease_of_endocrine_system ;
    :has_definition "An autoimmune disease of endocrine system that involves production of excessive amount of thyroid hormones, located_in thyroid gland." ;
    :has_exact_synonym "Grave's disease"@en,
        "Graves disease"@en,
        "exophthalmic goiter"@en ;
    :has_related_synonym "Basedow's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intermittent_proptosis rdfs:subClassOf :orbital_disease ;
    :has_exact_synonym "Intermittent exophthalmos"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malaria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :plasmodium ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        :parasitic_protozoa_infectious_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :parasitic_protozoa_infectious_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :plasmodium ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A parasitic protozoa infectious disease characterized as a vector-borne infectious disease caused by the presence of protozoan parasites of the genus Plasmodium in the red blood cells, transmitted from an infected to an uninfected individual by the bite of anopheline mosquitoes, and characterized by periodic attacks of chills and fever that coincide with mass destruction of blood cells and the release of toxic substances by the parasite at the end of each reproductive cycle." ;
    :has_exact_synonym "induced malaria"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prolapse_of_urethra rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :urethra ],
        :prolapse_of_female_genital_organ,
        :urethral_disease ;
    :has_definition "A prolapse of female genital organ that is characterized by the descent of the urethra from the normal anatomic location toward or through the vaginal opening." ;
    :has_exact_synonym "Urethrocele"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corneal_degeneration rdfs:subClassOf :corneal_disease,
        :eye_degenerative_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :eye_degenerative_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cornea ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bronchopneumonia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :pneumonia ],
        :pneumonia ;
    :has_definition "A pneumonia involving inflammation of lungs that begins in the terminal bronchioles, which become clogged with thick mucus that forms consolidated patches in adjacent lobules. It is caused by bacteria and viruses." ;
    :has_exact_synonym "Chest infection - bronchopneumonia"@en,
        "bronchial pneumonia"@en,
        "lobular pneumonia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:juvenile_spinal_muscular_atrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :young_adult_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :childhood_spinal_muscular_atrophy ;
    :has_definition "A childhood spinal muscular atrophy that has age of onset after 18 months and is characterized by muscle weakness after early childhood and the ability to stand and walk and that has_material_basis_in homozygous or compound heterozygous mutation in the SMN1 gene on chromosome 5q13." ;
    :has_exact_synonym "Spinal Muscular Atrophy Type 3",
        "Kugelberg-Welander disease"@en,
        "SMA3"@en,
        "Type III Spinal Muscular Atrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spinal_muscular_atrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :motor_neuron_disease ;
    :has_definition "A motor neuron disease that is a degenerative neuromuscular disease characterized by lower motor neuron degeneration associated with progressive muscle weakness and atrophy." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:complex_partial_epilepsy rdfs:subClassOf :focal_epilepsy ;
    :has_exact_synonym "Complex partial epileptic seizure"@en,
        "epilepsy, psychomotor"@en,
        "psychomotor epilepsy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dysentery rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        :intestinal_infectious_disease ;
    :has_definition "An intestinal infectious disease that involves inflammation of the intestines, especially colon, due to chemical irritants, bacteria, protozoa, or parasitic worms, which results in severe diarrhea with passage of mucus and blood." ;
    :has_exact_synonym "Infectious diarrhea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:shigellosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :vehicle_borne_ingestion_transmission ],
        :colonic_disease,
        :primary_bacterial_infectious_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :bacterial_infectious_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :colon ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A primary bacterial infectious disease that results_in infection located_in epithelium of colon, has_material_basis_in Shigella boydii, has_material_basis_in Shigella dysenteriae, has_material_basis_in Shigella flexneri, or has_material_basis_in Shigella sonnei, which produce toxins that can attack the lining of the large intestine, causing swelling, ulcers on the intestinal wall, and bloody diarrhea. The bacteria are transmitted_by ingestion of food and water contaminated with feces." ;
    :has_exact_synonym "Shigella boydii infectious disease"@en,
        "Shigella flexneri infectious disease"@en,
        "Shigella gastroenteritis"@en,
        "Shigella sonnei infectious disease"@en,
        "bacillary dysentery"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:balantidiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_cramp ],
        :parasitic_protozoa_infectious_disease ;
    :has_definition "A parasitic protozoa infectious disease involving infection caused by Balantidium coli. The trophozoites are capable of attacking the intestinal epithelium, creating ulcers and causing bloody diarrhea. The infectiou has_symptom cramping, has_symptom abdominal pain, has_symptom nausea and has_symptom foul breath." ;
    :has_exact_match "MESH:D001447" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nephrogenic_diabetes_insipidus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :polyuria ],
        :diabetes_insipidus ;
    :has_definition "A diabetes insipidus that is characterized by a complete or partial resistance of the kidneys to vasopressin (ADH)." ;
    :has_related_synonym "vasopressin-resistant diabetes insipidus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurohypophyseal_diabetes_insipidus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :central_diabetes_insipidus ;
    :has_definition "A central diabetes insipidus that is characterized by polyuria and polydipsia due to a deficiency in vasopressin synthesis and that has_material_basis_in heterozygous mutation in the arginine vasopressin gene (AVP) on chromosome 20p13." ;
    :has_exact_synonym "Pituitary diabetes insipidus"@en,
        "Vasopressin deficiency"@en,
        "vasopressin defective diabetes insipidus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pathological_gambling rdfs:subClassOf :impulse_control_disorder ;
    :has_definition "An impulse control disorder that involves the uncontrollable impulse to gamble, irrespective of the interference the behaviour has on the individual's life." ;
    :has_exact_synonym "Compulsive gambling"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leukemia rdfs:subClassOf :hematologic_cancer ;
    :has_definition "A cancer that affects the blood or bone marrow characterized by an abnormal proliferation of blood cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kleptomania rdfs:subClassOf :impulse_control_disorder ;
    :has_definition "An impulse control disorder that involves the repeated impulse to steal for no great gain, when he or she has sufficient money to pay for the item and no need for what is stolen." ;
    :has_exact_synonym "Pathological stealing"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intermittent_explosive_disorder rdfs:subClassOf :impulse_control_disorder ;
    :has_definition "An impulse control disorder that involves the episodic inability to control violent impulses with a disproportionate degree of aggressiveness." ;
    :has_exact_synonym "explosive personality disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyromania rdfs:subClassOf :impulse_control_disorder ;
    :has_definition "An impulse control disorder that involves the uncontrollable impulse to repeatedly set fires with no obvious motive." ;
    :has_exact_synonym "Pathological firesetting"@en,
        "firesetting behavior"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tinea_pedis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_desquamation ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :epidermophyton ;
                            rdf:rest [ rdf:first :trichophyton ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :foot ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        :dermatophytosis,
        :skin_disease ;
    :has_definition "A dermatophytosis that results_in fungal infection located_in skin of foot, especially between the toes, has_material_basis_in Trichophyton or has_material_basis_in Epidermophyton and has_symptom fissures, has_symptom scaling, has_symptom maceration, and eroded areas between the toes and on the plantar surface of the foot." ;
    :has_exact_synonym "Athlete's foot"@en,
        "Dermatophytosis of foot"@en ;
    :has_related_synonym "ringworm of foot"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:luxation_of_globe rdfs:subClassOf :globe_disease ;
    :has_exact_synonym "Luxation of eye"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:globe_disease rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease that involves the globe of the eye." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thyrocalcitonin_secretion_disease rdfs:subClassOf :thyroid_gland_disease ;
    :has_exact_synonym "disorder of thyrocalcitonin secretion"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:labia_minora_cancer rdfs:subClassOf :skin_cancer,
        :vulva_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
