    :has_definition "A glaucoma characterized by glaucomatous optic atrophy secondary to a lens abnormality and has_symptom progressive decreased vision, especially decreased peripheral vision. Phacogenic glaucoma can be caused by cataracts, trauma to the eye, or age-related damage that obstructs aqueous outflow, leading to inappropriately increased intraocular pressure and eventual optic nerve atrophy with associated vision loss." .

