:displacement_of_cardia_through_esophageal_hiatus rdfs:subClassOf :hiatus_hernia ;
    :has_exact_synonym "Congenital hiatus hernia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hiatus_hernia rdfs:subClassOf :stomach_disease ;
    :has_exact_synonym "Diaphragmatic - hiatus -hernia"@en,
        "hiatal hernia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vestibulocochlear_nerve_disease rdfs:subClassOf :cranial_nerve_disease,
        :retrocochlear_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :vestibulocochlear_nerve ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "acoustic nerve disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tooth_ankylosis rdfs:subClassOf :ankylosis,
        :teeth_hard_tissue_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ankylosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :calcareous_tooth ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Ankylosis of teeth"@en,
        "Ankylosis of tooth"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paracoccidioidomycosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :paracoccidioides_brasiliensis ],
        :primary_systemic_mycosis ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :primary_systemic_mycosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom [ owl:unionOf [ rdf:first :zone_of_skin ;
                                                    rdf:rest [ rdf:first :lymph_node ;
                                                            rdf:rest [ rdf:first :mucosa ;
                                                                    rdf:rest [ rdf:first :bone_element ;
                                                                            rdf:rest [ rdf:first :lung ;
                                                                                    rdf:rest :nil ] ] ] ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A primary systemic mycosis that results_in systemic fungal infection located_in mucosa, located_in lymph nodes, located_in bone, located_in skin or located_in lungs, has_material_basis_in Paracoccidioides brasiliensis." ;
    :has_exact_synonym "Mucocutaneous-lymphangitic paracoccidioidomycosis"@en,
        "paracoccidioidal mycosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blastomycosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lesions_in_lung ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :blastomyces_dermatitidis ],
        :primary_systemic_mycosis ;
    :has_definition "A primary systemic mycosis that results_in a systemic fungal infection, has_material_basis_in Blastomyces dermatitidis, transmitted_by airborne spores and has_symptom skin lesions, has_symptom lung lesions and has_symptom pleural thickening." ;
    :has_exact_synonym "Blastomyces Dermatitidis Infection"@en,
        "Blastomycotic infection"@en,
        "Chicago disease"@en,
        "Gilchrist's disease"@en,
        "Infection by Blastomyces dermatitidis"@en,
        "North American blastomycosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:binocular_vision_disease rdfs:subClassOf :strabismus ;
    :has_exact_synonym "simultaneous visual perception without fusion"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pseudobulbar_palsy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphagia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysarthria ],
        :brain_disease ;
    :has_definition "A brain disease that is characterized by damage to neurons of the corticobulbar tract, has_symptom dysarthria, has_symptom dysphagia, has_symptom spasticity located_in tongue, has_symptom gag reflex, and has_symptom emotional outbursts." ;
    :has_exact_synonym "pseudobulbar paralysis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vestibular_neuronitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vertigo ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :viruses ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        :poliomyelitis,
        :vestibulocochlear_nerve_disease ;
    :has_definition "A inner ear infectious disease caused by a viral infection which involves inflammation of the vestibular nerve. It usually results as a complication of an upper respiratory infection. This causes sudden and severe vertigo, nausea and vomiting. Auditory symptoms are usually absent." ;
    :has_exact_synonym "Epidemic neurolabyrinthitis"@en,
        "Vestibular neuritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_receptive_expressive_language_disorder rdfs:subClassOf :communication_disorder ;
    :has_definition "A communication disorder that involves both the receptive and expressive areas of communication may be affected in any degree, from mild to severe." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acoustic_neuroma rdfs:subClassOf :neurilemmoma ;
    :has_exact_synonym "Vestibular Neurilemmoma"@en,
        "Vestibular schwannoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:locked_in_syndrome rdfs:subClassOf :nervous_system_disease ;
    :has_definition "A nervous system disease that is characterized by complete paralysis of all voluntary muscles except for the ones that control the movements of the eyes." ;
    :has_exact_synonym "Locked in syndrome"@en,
        "Locked-in state"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gynecomastia rdfs:subClassOf :disorder_of_sexual_development ;
    :has_definition "A disorder of sexual development that is characterized by enlargement or swelling of male breast tissue resulting from elevated male estrogen levels or imbalanced estrogen and testosterone levels." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leiomyoma rdfs:subClassOf :cell_type_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :smooth_muscle_cell ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cell type benign neoplasm that is a benign tumor of smooth muscle cells." ;
    :has_exact_synonym "leiomyomatous neoplasm"@en,
        "leiomyomatous tumor"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_hemorrhagic_telangiectasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :vascular_disease ;
    :has_definition "A vascular disease characterized by the presence of multiple arteriovenous malformations that lack intervening capillaries and result in direct connections between arteries and veins." ;
    :has_exact_synonym "Osler hemorrhagic telangiectasia syndrome"@en,
        "Osler-Weber-Rendu disease"@en,
        "Rendu-Osler-Weber disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperprolactinemia rdfs:subClassOf :acquired_metabolic_disease ;
    :has_definition "An acquired metabolic disease that has_material_basis_in the presence of abnormally-high levels of prolactin in the blood." ;
    :has_exact_synonym "Chiari-Frommel syndrome"@en,
        "Pregnancy-related A-G syndrome"@en,
        "hyperprolactinaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ataxia_telangiectasia rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by cerebellar ataxia, telangiectases, immune defects, and a predisposition to malignancy and that has_material_basis_in homozygous or compound heterozygous mutation in the ATM gene on chromosome 11q22." ;
    :has_exact_match "MESH:D001260" ;
    :has_exact_synonym "Boder-Sedgwick syndrome"@en,
        "Louis Bar syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:friedreich_ataxia rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_exact_match "MESH:D005621" ;
    :has_exact_synonym "Friedreich ataxia 1"@en,
        "Friedreich's ataxia"@en,
        "Friedreich's tabes"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myoclonic_cerebellar_dyssynergia rdfs:subClassOf :neurodegenerative_disease ;
    :has_exact_synonym "Dyssynergia cerebellaris myoclonica"@en,
        "progressive cerebellar tremor"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:capillary_disease rdfs:subClassOf :vascular_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vascular_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :capillary ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A vascular disease that is located_in the capillaries." ;
    :has_exact_synonym "disease of capillaries"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:black_piedra rdfs:subClassOf :superficial_mycosis ;
    :has_definition "A superficial mycosis that is a superficial fungal infection of the hair shaft caused by Piedraia hortae, an ascomycetous fungus forming hard black nodules on the shafts of the scalp, beard, moustache and pubic hair." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nephronophthisis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :kidney_disease ;
    :has_definition "A kidney disease that is characterized by a chronic tubulointerstitial nephritis that progress to terminal renal failure during the second decade (juvenile form) or before the age of 5 years (infantile form) resulting from dysfunction of ciliary proteins (ciliopathy)." ;
    :has_exact_synonym "medullary cystic disease"@en,
        "medullary cystic kidney"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ellis_van_creveld_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by short limbs, short ribs, postaxial polydactyly, dysplastic nails and teeth, and in many patients congenital cardiac defects that has_material_basis_in homozygous or compound heterozygous mutation in either the EVC or EVC2 gene on chromosome 4p16.2." ;
    :has_exact_synonym "Chondroectodermal dysplasia"@en,
        "mesoectodermal dysplasia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:newborn_respiratory_distress_syndrome rdfs:subClassOf :respiratory_failure ;
    :has_definition "A respiratory failure that is characterized by deficiency of the surfactant coating the inner surface of the lungs, by failure of the lungs to expand and contract properly during breathing with resulting collapse, and by the accumulation of a protein-containing film lining the alveoli and their ducts." ;
    :has_exact_synonym "HMD - Hyaline membrane disease"@en,
        "Neonatal respiratory Distress syndrome"@en,
        "hyaline membrane disease"@en,
        "pulmonary hyaline membrane disease"@en,
        "pulmonary hypoperfusion syndrome of newborn"@en,
        "respiratory distress syndrome of newborn"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_gonococcal_salpingitis rdfs:subClassOf :chronic_salpingitis ;
    :has_definition "A chronic salpingitis that is caused by gonorrhea." ;
    :has_exact_synonym "Gonococcal salpingitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:telangiectasis rdfs:subClassOf :peripheral_vascular_disease ;
    :has_exact_synonym "telangiectasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_epiphyseal_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that has_material_basis_in defective cartilage mineralization into bone which results in irregular ossification centers of the located in hip or located in knee. The disease has symptom fatigue, has symptom joint pain." ;
    :has_exact_synonym "polyepiphyseal dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:respiratory_syncytial_virus_infectious_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :wheezing ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :human_orthopneumovirus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rhinorrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :droplet_spread_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection located_in upper respiratory tract or located_in lower respiratory tract, has_material_basis_in Human respiratory syncytial virus, which is transmitted_by droplet spread of nasal secretions from an infected person while coughing or sneezing, or transmitted_by contaminated fomites. The infection has_symptom runny nose, has_symptom fever, has_symptom cough, has_symptom wheezing, and has_symptom respiratory distress." ;
    :has_exact_synonym "RSV",
        "respiratory syncytial virus" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pars_planitis rdfs:subClassOf :chorioretinitis ;
    :has_exact_synonym "Posterior cyclitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intermediate_uveitis rdfs:subClassOf :uveitis ;
    :has_exact_synonym "chronic cyclitis"@en,
        "peripheral uveoretinitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypercementosis rdfs:subClassOf :teeth_hard_tissue_disease ;
    :has_exact_synonym "Cementation hyperplasia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hernia_of_ovary_and_fallopian_tube rdfs:subClassOf :female_reproductive_system_disease ;
    :has_definition "A female reproductive system disease that is characterized by the protrusion of the ovary and fallopian tube through a defect inthe abdominal wall." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cyclosporiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anorexia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :low_grade_fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        :coccidiosis ;
    :has_definition "A coccidiosis that involves infection of the intestine with the parasitic protozoan Cyclospora cayetanensis, which is transmitted by contaminated food and water. The symptoms include watery diarrhea, anorexia, weight loss, abdominal pain, nausea and vomiting, myalgias, low-grade fever, and fatigue." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lacrimal_duct_cancer rdfs:subClassOf :lacrimal_system_cancer ;
    :has_exact_synonym "malignant neoplasm of lacrimal duct"@en,
        "malignant tumor of lacrimal duct"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:choroid_cancer rdfs:subClassOf :choroid_disease,
        :uveal_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :optic_choroid ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Choroidal tumor"@en,
        "choroid neoplasm"@en,
        "malignant tumor of choroid"@en,
        "malignant tumor of the Choroid"@en,
        "neoplasm of choroid"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:migraine_without_aura rdfs:subClassOf :migraine ;
    :has_definition "A migraine that is characterized by migraine headaches that are not accompanied by an aura." ;
    :has_exact_synonym "common migraine"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diabetic_polyneuropathy rdfs:subClassOf :diabetic_neuropathy ;
    :has_exact_synonym "Diabetes mellitus with polyneuropathy"@en,
        "Polyneuropathy in diabetes"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ocular_motility_disease rdfs:subClassOf :cranial_nerve_disease,
        :eye_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cranial_nerve_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :eye ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "disorder of eye movements"@en,
        "eye movement disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hallucinogen_abuse rdfs:subClassOf :substance_abuse ;
    :has_definition "A substance abuse that involves the recurring use of hallucinogenic drugs despite negative consequences." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucopolysaccharidosis rdfs:subClassOf :lysosomal_storage_disease ;
    :has_definition "A lysosomal storage disease that involves the accumulation of glycosaminoglycans in the tissues and their excretion in the urine." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucopolysaccharidosis_ii rdfs:subClassOf :mucopolysaccharidosis ;
    :has_definition "A mucopolysaccharidosis characterized by a deficiency of the lysosomal enzyme iduronate sulfatase." ;
    :has_exact_synonym "Hunter syndrome"@en,
        "Hunter's syndrome"@en,
        "MPS II - Hunter syndrome"@en,
        "Mucopolysaccharidosis, MPS-II"@en,
        "deficiency of iduronate-2-sulphatase"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucopolysaccharidosis_vi rdfs:subClassOf :mucopolysaccharidosis ;
    :has_definition "A mucopolysaccharidosis characterized by a deficiency of the lysosomal enzyme N-acetylgalactosamine 4-sulfatase." ;
    :has_exact_synonym "MPS VI - Maroteaux-Lamy syndrome"@en,
        "Maroteaux - Lamy syndrome"@en,
        "Maroteaux-Lamy syndrome"@en,
        "arylsulfatase B deficiency"@en,
        "deficiency of N-acetylgalactosamine-4-sulfatase"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucopolysaccharidosis_iii rdfs:subClassOf :mucopolysaccharidosis ;
    :has_definition "A mucopolysaccharidosis characterized by a deficiency of the lysosomal enzyme resulting in incomplete breakdown of the heparan sulfate sugar chain." ;
    :has_exact_synonym "Mucopolysaccharidosis, MPS-III"@en,
        "N-sulphoglucosamine sulphohydrolase deficiency"@en,
        "Sanfilippo's syndrome"@en,
        "heparan sulfate sulfatase deficiency"@en ;
    :has_narrow_synonym "naglu deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucopolysaccharidosis_i rdfs:subClassOf :mucopolysaccharidosis ;
    :has_definition "A mucopolysaccharidosis characterized by a deficiency of the lysosomal enzyme alpha-L-iduronidase." ;
    :has_exact_synonym "Hurler syndrome"@en,
        "Hurler-Scheie syndrome"@en,
        "Lipochondrodystrophy"@en,
        "MPS I - Hurler syndrome"@en,
        "Mucopolysaccharidosis, MPS-I"@en,
        "Mucopolysaccharidosis, type 1"@en,
        "iduronidase deficiency disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sly_syndrome rdfs:subClassOf :mucopolysaccharidosis ;
    :has_definition "A mucopolysaccharidosis characterized by a deficiency of the lysosomal enzyme beta-glucuronidase resulting in the inability to degrade glucuronic acid-containing glycosaminoglycans." ;
    :has_exact_synonym "MPS VII - Sly syndrome"@en,
        "beta-glucuronidase deficiency"@en,
        "deficiency of beta-glucuronidase"@en,
        "mucopolysaccharidosis VII"@en .

