    :has_exact_synonym "Mucopolysaccharidosis, MPS-IV"@en,
        "deficiency of N-acetylgalactosamine-6-sulphatase"@en,
        "deficiency of chondroitinsulphatase"@en,
        "galactosamine-6-sulfatase deficiency"@en ;
    :has_narrow_synonym "Osteochondrodystrophy"@en,
        "chondroosteodystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

