@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:enterocele rdfs:subClassOf :prolapse_of_female_genital_organ ;
    :has_definition "A prolapse of female genital organ that is characterized by the descent of a peritoneal sac containing small bowel into the rectovagnial space causing a bulge in the posterior vaginal wall." ;
    :has_exact_synonym "vaginal enterocele"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:quadriplegia rdfs:subClassOf :central_nervous_system_disease ;
    :has_exact_synonym "tetraplegia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:senile_entropion rdfs:subClassOf :entropion ;
    :has_exact_synonym "Involutional entropion"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thyroid_crisis rdfs:subClassOf :thyroid_gland_disease ;
    :has_exact_synonym "Thyrotoxic crisis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

