    :has_definition "A female reproductive system disease that is characterized by the descent of one or more of the pelvic structures (bladder, uterus, vagina) from the normal anatomic location toward or through the vaginal opening." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

