            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :ancylostoma ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :gastrointestinal_bleeding ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :zone_of_skin ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :eye ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :viscus ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :severe_diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cachexia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anemia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        :eye_disease,
        :parasitic_helminthiasis_infectious_disease,
        :skin_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves infection of skin, eyes, and viscera in humans by the parasitic nematodes Ancylostoma braziliense, Ancylostoma ceylanicum, Ancylostoma duodenale or Ancylostoma caninum. The larvae cause lesions on the skin at the site of penetration. The infection has_symptom intestinal bleeding, has_symptom abdominal pain, has_symptom anemia, has_symptom severe diarrhea and has_symptom malnutrition." ;
    :has_exact_match "MESH:D000724" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:guillain_barre_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :peripheral_nervous_system ],
        :autoimmune_disease_of_peripheral_nervous_system ;
    :has_definition "An autoimmune disease of peripheral nervous system that causes body's immune system to attack part of the peripheral nervous system." ;
    :has_exact_synonym "acute inflammatory demyelinating polyradiculopathy",
        "Infectious neuronitis"@en,
        "Post-infectious polyneuritis"@en,
        "Postinfectious polyneuritis"@en,
        "acute infective polyneuritis"@en,
        "acute postinfectious polyneuropathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

