    :has_definition "A neurodegenerative disease that has_material_basis_in autosomal dominant inheritance and is characterized by unwanted choreatic movements, behavioral and psychiatric disturbances and dementia and has_material_basis_in expansion of CAG triplet repeats (glutamine) resulting in neuron degeneration affecting muscle coordination, cognitive abilities." ;
    :has_exact_synonym "HD"@en,
        "Huntington disease"@en,
        "Huntington's chorea"@en .

