    :has_definition "A movement disease characterized by brief, semi-directed, irregular movements that not repetitive or rhythmic, but appear to flow from one muscle to the next." ;
    :has_exact_synonym "chorea"@en,
        "hereditary chorea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
