    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cardiovascular_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease of anatomical entity which occurs in the blood, heart, blood vessels or the lymphatic system that passes nutrients (such as amino acids and electrolytes), gases, hormones, blood cells or lymph to and from cells in the body to help fight diseases and help stabilize body temperature and pH to maintain homeostasis." ;
    :has_exact_synonym "disease of subdivision of hemolymphoid system"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypochondriasis rdfs:subClassOf :somatoform_disorder ;
    :has_definition "A somatoform disorder that involves an excessive preoccupation or worry about having a serious illness." ;
    :has_exact_synonym "Hypochondria"@en,
        "Hypochondriacal disorder"@en,
        "hypochondriacal neurosis"@en .

