            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lacazia_loboi ],
        :dermatomycosis ;
    :has_definition "A dermatomycosis that results in infection located in skin or located in subcutaneous tissue, has_material_basis_in Lacazia loboi and has symptom crusty plaques, has symptom tumors and results in formation of nodular lesions." ;
    :has_exact_synonym "Cutaneous lobomycosis"@en,
        "infection by Loboa loboi"@en ;
    :has_related_synonym "Cutaneous blastomycosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transient_global_amnesia rdfs:subClassOf :amnestic_disorder ;
    :has_definition "An amnestic disorder that is characterized by temporary but almost total disruption of short-term memory with a range of problems accessing older memories." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:relapsing_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :borrelia ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :tick_borne_transmission ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in infection, has_material_basis_in Borrelia, which is transmitted_by tick or transmitted_by body louse." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:louse_borne_relapsing_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :relapsing_fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatosplenomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tachycardia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tachypnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :enlargement_of_lymph_nodes ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :pediculus_humanus ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :insect_borne_transmission ],
        :relapsing_fever ;
    :has_definition "A relapsing fever that is characterized by relapsing or recurring episodes of fever, has_material_basis_in Borrelia recurrentis, which is transmitted_by body louse (Pediculus humanus). The infection has_symptom tachypnea, has_symptom tachycardia, has_symptom hepatosplenomegaly and has_symptom lymphadenopathy." ;
    :has_exact_synonym "Relapsing fever, louse-borne"@en .
